No syntax sugar doesn't mean we can't at least make things a little easier for ourselves. Enter the VolatilePtr<T> type, which is a newtype over a *mut T . One of those "manual" newtypes I mentioned where we can't use our nice macro. #[derive(Debug, Clone, Copy, Hash, PartialEq, Eq, PartialOrd, Ord)]
#[repr(transparent)]
pub struct VolatilePtr<T>(pub *mut T); Obviously we want to be able to read and write: impl<T> VolatilePtr<T> { /// Performs a `read_volatile`. pub unsafe fn read(self) -> T { self.0.read_volatile() } /// Performs a `write_volatile`. pub unsafe fn write(self, data: T) { self.0.write_volatile(data); } And we want a way to jump around when we do have volatile memory that's in blocks. This is where we can get ourselves into some trouble if we're not careful. We have to decide between offset and wrapping_offset . The difference is that offset optimizes better, but also it can be Undefined Behavior if the result is not "in bounds or one byte past the end of the same allocated object". I asked ubsan (who is the expert that you should always listen to on matters like this) what that means exactly when memory mapped hardware is involved (since we never allocated anything), and the answer was that you can use an offset in statically memory mapped situations like this as long as you don't use it to jump to the address of something that Rust itself allocated at some point. Cool, we all like being able to use the one that optimizes better. Unfortunately, the downside to using offset instead of wrapping_offset is that with offset , it's Undefined Behavior simply to calculate the out of bounds result (with wrapping_offset it's not Undefined Behavior until you use the out of bounds result). We'll have to be quite careful when we're using offset . /// Performs a normal `offset`. pub unsafe fn offset(self, count: isize) -> Self { VolatilePtr(self.0.offset(count)) } Now, one thing of note is that doing the offset isn't const . The math for it is something that's possible to do in a const way of course, but Rust basically doesn't allow you to fiddle raw pointers much during const right now. Maybe in the future that will improve. If we did want to have a const function for finding the correct address within a volatile block of memory we'd have to do all the math using usize values, and then cast that value into being a pointer once we were done. It'd look something like this: const fn address_index<T>(address: usize, index: usize) -> usize { address + (index * std::mem::size_of::<T>())
} But, back to methods for VolatilePtr , well we sometimes want to be able to cast a VolatilePtr between pointer types. Since we won't be able to do that with as , we'll have to write a method for it: /// Performs a cast into some new pointer type. pub fn cast<Z>(self) -> VolatilePtr<Z> { VolatilePtr(self.0 as *mut Z) }

