That was a lot of small code blocks, let's look at it all put together: #[derive(Debug, Clone, Copy, PartialEq, Eq, PartialOrd, Ord, Hash)]
#[repr(transparent)]
pub struct VolatilePtr<T>(pub *mut T);
impl<T> VolatilePtr<T> { pub unsafe fn read(self) -> T { self.0.read_volatile() } pub unsafe fn write(self, data: T) { self.0.write_volatile(data); } pub unsafe fn offset(self, count: isize) -> Self { VolatilePtr(self.0.offset(count)) } pub fn cast<Z>(self) -> VolatilePtr<Z> { VolatilePtr(self.0 as *mut Z) } pub unsafe fn iter_slots(self, slots: usize) -> VolatilePtrIter<T> { VolatilePtrIter { vol_ptr: self, slots, } }
}
impl<T> core::fmt::Pointer for VolatilePtr<T> { fn fmt(&self, f: &mut core::fmt::Formatter) -> core::fmt::Result { write!(f, "{:p}", self.0) }
} #[derive(Debug, Clone, Hash, PartialEq, Eq)]
pub struct VolatilePtrIter<T> { vol_ptr: VolatilePtr<T>, slots: usize,
}
impl<T: Clone> Iterator for VolatilePtrIter<T> { type Item = VolatilePtr<T>; fn next(&mut self) -> Option<VolatilePtr<T>> { if self.slots > 0 { let out = Some(self.vol_ptr.clone()); self.slots -= 1; self.vol_ptr = unsafe { self.vol_ptr.clone().offset(1) }; out } else { None } }
}

