The most basic version of the macro we want goes like this: #[macro_export]
macro_rules! newtype { ($new_name:ident, $old_name:ident) => { #[repr(transparent)] pub struct $new_name($old_name); };
} Except we also want to be able to add attributes (which includes doc comments), so we upgrade our macro a bit: #[macro_export]
macro_rules! newtype { ($(#[$attr:meta])* $new_name:ident, $old_name:ident) => { $(#[$attr])* #[repr(transparent)] pub struct $new_name($old_name); };
} And we want to automatically add the ability to turn the wrapper type back into the wrapped type. #[macro_export]
macro_rules! newtype { ($(#[$attr:meta])* $new_name:ident, $old_name:ident) => { $(#[$attr])* #[repr(transparent)] pub struct $new_name($old_name); impl From<$new_name> for $old_name { fn from(x: $new_name) -> $old_name { x.0 } } };
} That seems like enough for all of our examples, so we'll stop there. We could add more things: Making the From impl being optional. We'd have to make the newtype invocation be more complicated somehow, the user puts ", no-unwrap" after the inner type declaration or something, or something like that. Allowing for more precise visibility controls on the wrapping type and on the inner field. This would add a lot of line noise, so we'll just always have our newtypes be pub . Allowing for generic newtypes, which might sound silly but that we'll actually see an example of soon enough. To do this you might think that we can change the :ident declarations to :ty , but since we're declaring a fresh type not using an existing type we have to accept it as an :ident . The way you get around this is with a proc-macro, which is a lot more powerful but which also requires that you write the proc-macro in an entirely other crate that gets compiled first. We don't need that much power, so for our examples we'll go with the macro_rules version and just do it by hand in the few cases where we need a generic newtype. Allowing for Deref and DerefMut , which usually defeats the point of doing the newtype, but maybe sometimes it's the right thing, so if you were going for the full industrial strength version with a proc-macro and all you might want to make that part of your optional add-ons as well the same way you might want optional From . You'd probably want From to be "on by default" and Deref / DerefMut to be "off by default", but whatever. As a reminder: remember that macro_rules macros have to appear before they're invoked in your source, so the newtype macro will always have to be at the very top of your file, or if you put it in a module within your project you'll need to declare the module before anything that uses it.

